INSERT INTO employee VALUES ('1', 'Davolio', 'Nancy', 'Sales Representative', 'Ms.', '1978-12-08 00:00:00', '2019-05-01 00:00:00', '507 - 20th Ave. E.\r\nApt. 2A', 'Seattle', 'WA', '98122', 'USA', '(206) 555-9857', '5467', 'Education includes a BA in psychology from Colorado State University in 1995.  She also completed \"The Art of the Cold Call.\"  Nancy is a member of Toastmasters International.', '2');
INSERT INTO employee VALUES ('2', 'Fuller', 'Andrew', 'Vice President, Sales', 'Dr.', '1980-02-19 00:00:00', '2008-08-14 00:00:00', '908 W. Capital Way', 'Tacoma', 'WA', '98401', 'USA', '(206) 555-9482', '3457', 'Andrew received his BTS commercial in 2000 and a Ph.D. in international marketing from the University of Dallas in 2008.  He is fluent in French and Italian and reads German.  He joined the company as a sales representative, was promoted to sales manager in January 2010 and to vice president of sales in March 2015.  Andrew is a member of the Sales Management Roundtable, the Seattle Chamber of Commerce, and the Pacific Rim Importers Association.', null);
INSERT INTO employee VALUES ('3', 'Leverling', 'Janet', 'Sales Representative', 'Ms.', '1963-08-30 00:00:00', '2019-04-01 00:00:00', '722 Moss Bay Blvd.', 'Kirkland', 'WA', '98033', 'USA', '(206) 555-3412', '3355', 'Janet has a BS degree in chemistry from Boston College (1988).  She has also completed a certificate program in food retailing management.  Janet was hired as a sales associate in 2019 and promoted to sales representative in February 2002.', '2');
INSERT INTO employee VALUES ('4', 'Peacock', 'Margaret', 'Sales Representative', 'Mrs.', '1969-09-19 00:00:00', '2019-05-03 00:00:00', '4110 Old Redmond Rd.', 'Redmond', 'WA', '98052', 'USA', '(206) 555-8122', '5176', 'Margaret holds a BA in English literature from Concordia College (1996) and an MA from the American Institute of Culinary Arts (1998).  She was assigned to the London office temporarily from July through November 2020.', '2');
INSERT INTO employee VALUES ('5', 'Buchanan', 'Steven', 'Sales Manager', 'Mr.', '1980-03-04 00:00:00', '2019-10-17 00:00:00', '14 Garrett Hill', 'London', null, 'SW1 8JR', 'UK', '(71) 555-4848', '3453', 'Steven Buchanan graduated from St. Andrews University, Scotland, with a BSC degree in 2006.  Upon joining the company as a sales representative in 2019, he spent 6 months in an orientation program at the Seattle office and then returned to his permanent post in London.  He was promoted to sales manager in March 2021.  Mr. Buchanan has completed the courses \"Successful Telemarketing\" and \"International Sales Management.\"  He is fluent in French.', '2');
INSERT INTO employee VALUES ('6', 'Suyama', 'Michael', 'Sales Representative', 'Mr.', '1988-07-02 00:00:00', '2019-10-17 00:00:00', 'Coventry House\r\nMiner Rd.', 'London', null, 'EC2 7JR', 'UK', '(71) 555-7773', '428', 'Michael is a graduate of Sussex University (MA, economics, 2011) and the University of California at Los Angeles (MBA, marketing, 2012).  He has also taken the courses \"Multi-Cultural Selling\" and \"Time Management for the Sales Professional.\"  He is fluent in Japanese and can read and write French, Portuguese, and Spanish.', '5');
INSERT INTO employee VALUES ('7', 'King', 'Robert', 'Sales Representative', 'Mr.', '1975-05-29 00:00:00', '2020-01-02 00:00:00', 'Edgeham Hollow\r\nWinchester Way', 'London', null, 'RG1 9SP', 'UK', '(71) 555-5598', '465', 'Robert King served in the Peace Corps and traveled extensively before completing his degree in English at the University of Michigan in 2020, the year he joined the company.  After completing a course entitled \"Selling in Europe,\" he was transferred to the London office in March 2021.', '5');
